import React from "react";

const Help = () => {
  return(
    <section className="help">
      <div className="conatiner">
        <div className="help__flex">
          <h1 className="help__title">
          How you can help
          <div></div>
          our shelter
          </h1>
        </div>
        
      </div>
    </section>
  );
};

export default Help;
